// src/components/TabelaOrdensServico.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/OrdensServico.css';

const TabelaOrdensServico = () => {
  const [ordens, setOrdens] = useState([]);
  const [filtro, setFiltro] = useState({
    status: '',
    tipoVisita: '',
    modalidade: ''
  });

  const [ordensFiltradas, setOrdensFiltradas] = useState([]);

  useEffect(() => {
    const dadosMockados = [
      {
        id: 1,
        numero_protocolo: 'PROTOCOLO123',
        nome_solicitante: 'João Silva',
        telefone_solicitante: '11987654321',
        data_abertura: '2025-05-05',
        data_agendamento: '2025-05-10',
        tipo_visita: 'Técnico',
        modalidade: 'Presencial',
        nome_empresa: 'Hospital Santa Clara',
        endereco: 'Rua A, 123',
        problema_reportado: 'Equipamento não liga',
        nome_tecnico: 'Carlos Souza',
        descricao_servico: 'Substituição da fonte de alimentação',
        estado_equipamento: 'Funcional após reparo',
        nome_acompanhante: 'Maria Oliveira',
        status: 'Aguardando Atendimento',
        comentario_observacoes: 'Sem observações adicionais',
        pecas_utilizadas: 'Fonte de alimentação XZY123',
        equipamento: 'Monitor de sinais vitais DX200',
        assinatura_acompanhante: '',
        assinatura_tecnico: '',
        data_finalizacao: ''
      }
      // Adicione mais ordens se quiser testar múltiplos filtros
    ];

    setOrdens(dadosMockados);
    setOrdensFiltradas(dadosMockados);
  }, []);

  const aplicarFiltros = () => {
    const resultado = ordens.filter((ordem) => {
      const statusOk = filtro.status === '' || ordem.status === filtro.status;
      const visitaOk = filtro.tipoVisita === '' || ordem.tipo_visita === filtro.tipoVisita;
      const modalidadeOk = filtro.modalidade === '' || ordem.modalidade === filtro.modalidade;
      return statusOk && visitaOk && modalidadeOk;
    });

    setOrdensFiltradas(resultado);
  };

  return (
    <div>
      <div style={{ marginBottom: '20px' }}>
        <select
          value={filtro.status}
          onChange={(e) => setFiltro({ ...filtro, status: e.target.value })}
        >
          <option value="">Filtrar por Status</option>
          <option value="Aguardando Atendimento">Aguardando Atendimento</option>
          <option value="Em Pendencia">Em Pendência</option>
          <option value="Realizado Em Validação">Realizado Em Validação</option>
          <option value="Finalizado">Finalizado</option>
          <option value="Atrasado">Atrasado</option>
        </select>

        <select
          value={filtro.tipoVisita}
          onChange={(e) => setFiltro({ ...filtro, tipoVisita: e.target.value })}
          style={{ marginLeft: '10px' }}
        >
          <option value="">Filtrar por Tipo de Visita</option>
          <option value="Técnico">Técnico</option>
          <option value="Científico">Científico</option>
        </select>

        <select
          value={filtro.modalidade}
          onChange={(e) => setFiltro({ ...filtro, modalidade: e.target.value })}
          style={{ marginLeft: '10px' }}
        >
          <option value="">Filtrar por Modalidade</option>
          <option value="Presencial">Presencial</option>
          <option value="Remoto">Remoto</option>
        </select>

        <button onClick={aplicarFiltros} style={{ marginLeft: '10px' }}>
          Aplicar Filtros
        </button>
      </div>

      <table border="1" cellPadding="8" width="100%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Protocolo</th>
            <th>Solicitante</th>
            <th>Telefone</th>
            <th>Data Abertura</th>
            <th>Agendamento</th>
            <th>Serviço</th>
            <th>Equipamento</th>
            <th>Peças</th>
            <th>Status</th>
            <th>Visita</th>
            <th>Modalidade</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {ordensFiltradas.length > 0 ? (
            ordensFiltradas.map((ordem) => (
              <tr key={ordem.id}>
                <td>{ordem.id}</td>
                <td>{ordem.numero_protocolo}</td>
                <td>{ordem.nome_solicitante}</td>
                <td>{ordem.telefone_solicitante}</td>
                <td>{new Date(ordem.data_abertura).toLocaleDateString()}</td>
                <td>{new Date(ordem.data_agendamento).toLocaleDateString()}</td>
                <td>{ordem.descricao_servico}</td>
                <td>{ordem.equipamento}</td>
                <td>{ordem.pecas_utilizadas}</td>
                <td>{ordem.status}</td>
                <td>{ordem.tipo_visita}</td>
                <td>{ordem.modalidade}</td>
                <td>
                  <Link to={`/ordem-servico/${ordem.id}`}>
                    <button>Validar</button>
                  </Link>
                  <Link to={`/editar/${ordem.id}`}>
                    <button>Atender OS</button>
                  </Link>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="13" style={{ textAlign: 'center' }}>
                Nenhuma ordem encontrada com os filtros selecionados.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default TabelaOrdensServico;
